<title>dictstackunderflow</title>
</head>
<body>
	<h3>dictstackunderflow (error)</h3>
	<p>An attempt has been made to remove (end) the bottommost instance
		of userdict from the dictionary stack. This occurs if an end is
		executed for which there was no corresponding begin.</p>
	<p>
		<b>See Also:</b> <a href="../e/end.html">end</a>
	</p>
</body>
